import React, { useEffect, useState } from "react";
import axios from "axios";

const Test = () => {
  const [data, setData] = useState([]);
  const [input, setInput] = useState("");
  const requestGET = () => {
    useEffect(() => {
      axios
        .get("api/hello")
        .then((response) => {
          console.log(response);
          setData(response.data);
        })
        .catch((err) => {
          console.log(err);
        });
    }, []);
  };

  const handleInputChange = (e) => {
    setInput(e.target.value);
    console.log(input);
  };

  const handleClick = () => {
    console.log(input);
    axios
      .post("api/hello", {
        name: input,
      })
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  return (
    <div>
      <ul>
        {data.map((data) => (
          <li key={data}>{data}</li>
        ))}
      </ul>
      <input
        type="text"
        placeholder="input the text"
        onChange={handleInputChange}
      ></input>
      <button onClick={handleClick}>submit</button>
      <button onClick={requestGET}>submit</button>
    </div>
  );
};

export default Test;
